import{_ as t,W as l,X as r,a1 as d}from"./framework-474f8844.js";const i={},o=d("<table><thead><tr><th></th><th>类别</th><th>原因短语</th></tr></thead><tbody><tr><td>1XX</td><td>Informational（信息性状态码）</td><td>接受的请求正在处理</td></tr><tr><td>2XX</td><td>Success（成功状态码）</td><td>请求正常处理完毕</td></tr><tr><td>3XX</td><td>Redirection（重定向状态码）</td><td>需要进行附加操作以完成请求</td></tr><tr><td>4XX</td><td>Client Error（客户端错误状态码）</td><td>服务器无法处理请求</td></tr><tr><td>5XX</td><td>Server Error（服务器错误状态码）</td><td>服务器处理请求出错</td></tr></tbody></table><p><strong>1XX——等下，别急</strong></p><ul><li>100：收到了初始部分，请客户端继续</li><li>101：切换协议</li></ul><p><strong>2XX——成了</strong></p><ul><li>200：请求成功</li><li>202：请求被接受，但服务器还未对其执行任何操作</li><li>204：请求倒是成功了，但是没资源返回</li><li>206：是对资源某一部分的请求</li></ul><p><strong>3XX——不在这了，滚一边去</strong></p><ul><li>301：永久重定向</li><li>302：临时重定向</li><li>303：应该用另一个URL来获取资源</li><li>304：服务器资源没改变，直接使用客户端缓存</li></ul><p><strong>4XX——我（客户端）挂了</strong></p><ul><li>400：发的请求有语法错误</li><li>401：表明你首先需要登录</li><li>403：对请求资源的访问被<strong>拒绝</strong>了</li><li>404：请求资源不存在</li></ul><p><strong>5XX——你（服务器）挂了</strong></p><ul><li>500：服务器出错</li><li>503：服务器超负载或停机维护</li></ul>",11),e=[o];function s(n,X){return l(),r("div",null,e)}const c=t(i,[["render",s],["__file","http-status-code.html.vue"]]);export{c as default};
